import React from "react";
import "./style.css";

function Gameinfo() {
  return (

  <header className="Game-info">
      <h1>Clicky Game</h1>
      <p>Click on an image to earn points, but don't click on any more than once!</p>
  </header>

  );
}

export default Gameinfo;
